import React from "react";
import { useForm, ValidationError } from "@formspree/react";
import "./css/contact.css";
const Contact = () => {
  const [state, handleSubmit] = useForm("mpzvllnp");
  if (state.succeeded) {
    alert("Submitted");
  }
  const borderColor = ()=>{
    {
      border:'#c770f0'
    }
  }
  return (
    <>
      <div className="formmain">
        <form onSubmit={handleSubmit} className="formcontainer">
          <label htmlFor="name" className="formlabel">
            Name
          </label>
          <input id="name" type="text" name="name" className="inputfield" onClick={borderColor}/>
          <ValidationError prefix="Name" field="name" errors={state.errors} />
          <label htmlFor="email" className="formlabel">
            Email Address
          </label>
          <input id="email" type="email" name="email" className="inputfield" />
          <ValidationError prefix="Email" field="email" errors={state.errors} />
          <label htmlFor="message" className="formlabel">
            Message
          </label>
          <textarea id="message" name="message" className="inputfield"/>
          <ValidationError
            prefix="Message"
            field="message"
            errors={state.errors}
          />
          <button type="submit" className="formbtn" disabled={state.submitting}>
            Submit
          </button>
        </form>
      </div>
    </>
  );
};
export default Contact;
